A scientist and neo-Nazi doctor named Serafin has developed a way to create a physically superior human being. He tests it out on his adopted daughter, Goldine. From childhood, Goldine's father has injected her with vitamins and hormones. Now that she is grown, it is time to give her a test run. Serafin declares that his &quot;goldengirl&quot; will enter and win three races at the 1980 Moscow Olympics. To subsidize his work, Serafin sells shares in his daughter's future to a syndicate of businessmen, who send merchandising expert Dryden to look out for their interests. Goldine's personal and emotional development, meanwhile, is left in the hands of a psychologist, Dr. Lee.

Goldine competes in Moscow, with unexpected results.

